Comment:
I guess this game is about the origin of the Templars which echoes the story of Assassin's Creed: Origin. We all see that this game is vastly different from the previous ones, plus two hidden hints indicating this story is about the Templars. 1: no hidden blade used in the game, but it could possibly be explained by the fact that Odyssey is earlier than the invention of the hidden blade. 2 which is more decisive: no eagle shows up in the trailer, which essentially is the symbol of assassins. 
The only three trailers don't have an eagle in are:
     1. Assassin's Creed II, in which a sound of an eagle is displayed instead;
     2. Assassin's Creed Black Flag, in which the ship itself is named after the bird Jackdaw and it is quite unnatural to have an eagle on the Atlantic;
     3. Assassin's Creed Rogue, in which the hero himself betrays the assassins.
Just guessing lol
